  render() {
    return (
      <header>
        <h1>{this.props.title}</h1>
        <p>{this.props.sub}</p>
      </header>
    );
  }
}

class Content extends Component {
  render() {
    return (
      <article>
        <h2>{this.props.title}</h2>
        <p>{this.props.des}</p>
      </article>

    );
  }
}

class App extends Component {
  render() {
    return (
      <div className="App">
        <Subject title ="1" sub = "1.1"/>
        <Subject title ="2" sub = "2.1"/>
        <TOC/>
        <Content title="html" des = "i can do it!"/>
      </div>
    );
  }
}

export default App;
